import React from 'react';
// import "isomorphic-fetch";

const Home  = ({quotes}) => (

<div>
{quotes.map(e => (

<p>{e.name}</p>

))}

</div>
);
Home.getInitialProps = async () => {
    const response = await fetch('https://breakingbadapi.com/api/characters?limit=10&offset=1');
    const quotes = await response.json();
    console.log(quotes.length);
    return{quotes};

};



export default Home
